contracts/AbstractVault.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";

/**
 * @title AbstractVault
 * @dev Base contract for all SafeVault types. 
 *      simplified to handle ONLY Native C2FLR.
 */
abstract contract AbstractVault is Ownable, ReentrancyGuard {
    
    string public purpose;
    
    // Events
    event Deposited(address indexed user, uint256 amount, uint256 timestamp);
    event Withdrawn(address indexed user, uint256 amount, uint256 timestamp, string typeOfWithdrawal);
    event VaultInitialized(string purpose);

    constructor(string memory _purpose, address _owner) Ownable(_owner) {
        purpose = _purpose;
        emit VaultInitialized(_purpose);
    }

    /**
     * @dev Core deposit function. Accepts Native C2FLR.
     */
    function deposit() external payable virtual nonReentrant {
        require(msg.value > 0, "Amount must be > 0");
        emit Deposited(msg.sender, msg.value, block.timestamp);
        _onDeposit(msg.sender, msg.value);
    }

    /**
     * @dev Hook for child contracts
     */
    function _onDeposit(address _user, uint256 _amount) internal virtual {}

    /**
     * @dev Returns total Native balance of the vault
     */
    function totalAssets() public view virtual returns (uint256) {
        return address(this).balance;
    }
    
    // Allow receiving native tokens directly
    receive() external payable {
        if(msg.value > 0) {
            emit Deposited(msg.sender, msg.value, block.timestamp);
            _onDeposit(msg.sender, msg.value);
        }
    }
}

contracts/KineticVault.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "./AbstractVault.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";

interface IKToken {
    function mint(uint mintAmount) external returns (uint);
    function redeemUnderlying(uint redeemAmount) external returns (uint);
    function balanceOfUnderlying(address owner) external returns (uint);
    function underlying() external view returns (address);
}

/**
 * @title KineticVault
 * @dev Savings Vault that earns yield on Kinetic and splits the "Bonus" with the user.
 */
contract KineticVault is AbstractVault {
    using SafeERC20 for IERC20;

    IERC20 public immutable token; // USDT0
    IKToken public immutable kToken; // kUSDT0
    
    uint256 public unlockTimestamp;
    uint256 public principalBalance; 
    uint256 public penaltyBps; 
    uint256 public bonusSplitBps; 
    
    address public treasury; 
    address public factory;

    event BonusDistributed(address indexed user, uint256 userBonus, uint256 treasuryFee);

    constructor(
        address _token,
        address _kToken,
        string memory _purpose,
        address _owner,
        uint256 _unlockTimestamp,
        uint256 _penaltyBps,
        uint256 _bonusSplitBps,
        address _treasury
    ) AbstractVault(_purpose, _owner) {
        token = IERC20(_token);
        kToken = IKToken(_kToken);
        unlockTimestamp = _unlockTimestamp;
        penaltyBps = _penaltyBps;
        bonusSplitBps = _bonusSplitBps;
        treasury = _treasury;
        factory = msg.sender;
    }

    /**
     * @dev Step 1: Hold (Pull money into the contract)
     */
    function deposit(uint256 amount) external nonReentrant {
        require(msg.sender == owner() || msg.sender == factory, "Unauthorized");
        require(amount > 0, "Amount must be > 0");
        
        token.safeTransferFrom(msg.sender, address(this), amount);
        
        _supplyHeldBalance(amount);
    }

    /**
     * @dev Step 2: Supply (Move from contract balance to Kinetic)
     */
    function supplyHeldBalance(uint256 amount) external {
        require(msg.sender == factory, "Only Factory");
        _supplyHeldBalance(amount);
    }

    function _supplyHeldBalance(uint256 amount) internal {
        // PER USER GUIDE: Vault must explicitly approve Kinetic before minting
        // Use forceApprove to handle tokens that require zeroing out allowance (like USDT)
        token.forceApprove(address(kToken), amount);

        uint256 result = kToken.mint(amount);
        require(result == 0, "Kinetic mint failed");

        principalBalance += amount;
        emit Deposited(owner(), amount, block.timestamp);
    }

    function withdraw() external onlyOwner nonReentrant {
        uint256 currentTotalBalance = kToken.balanceOfUnderlying(address(this));
        require(currentTotalBalance > 0, "No funds");

        uint256 result = kToken.redeemUnderlying(currentTotalBalance);
        require(result == 0, "Kinetic redeem failed");

        if (block.timestamp >= unlockTimestamp) {
            uint256 yieldGenerated = 0;
            if (currentTotalBalance > principalBalance) {
                yieldGenerated = currentTotalBalance - principalBalance;
            }

            uint256 userBonus = (yieldGenerated * bonusSplitBps) / 10000;
            uint256 projectShare = yieldGenerated - userBonus;

            if (projectShare > 0) {
                token.safeTransfer(treasury, projectShare);
            }
            
            token.safeTransfer(msg.sender, principalBalance + userBonus);
            emit Withdrawn(msg.sender, principalBalance + userBonus, block.timestamp, "MATURITY_WITH_BONUS");
            emit BonusDistributed(msg.sender, userBonus, projectShare);
        } else {
            uint256 penalty = (principalBalance * penaltyBps) / 10000;
            uint256 userPayout = principalBalance - penalty;
            uint256 projectTotal = (currentTotalBalance - userPayout);
            
            if (projectTotal > 0) {
                token.safeTransfer(treasury, projectTotal);
            }
            if (userPayout > 0) {
                token.safeTransfer(msg.sender, userPayout);
            }
            emit Withdrawn(msg.sender, userPayout, block.timestamp, "EARLY_EXIT_NO_BONUS");
        }
        principalBalance = 0;
    }

    function totalAssets() public view override returns (uint256) {
        return principalBalance; 
    }
}

