// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "./KineticVault.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

/**
 * @title KineticVaultFactory
 * @dev Deploys KineticVault instances for yield-bearing savings.
 */
contract KineticVaultFactory is Ownable {
    using SafeERC20 for IERC20;

    address public immutable token; // Underlying (USDT0)
    address public immutable kToken; // kUSDT0
    address public protocolTreasury;

    address[] public allVaults;
    mapping(address => bool) public isVault;
    mapping(address => address[]) public userVaults;

    event KineticVaultCreated(
        address indexed vaultAddress, 
        address indexed owner, 
        string purpose, 
        uint256 unlockTime,
        uint256 initialDeposit
    );

    constructor(address _token, address _kToken, address _protocolTreasury) Ownable(msg.sender) {
        token = _token;
        kToken = _kToken;
        protocolTreasury = _protocolTreasury;
    }

    /**
     * @dev Creates a new KineticVault and seeds it with an initial deposit.
     * Follows the "Hold then Supply" architecture.
     */
    function createKineticVault(
        string memory _purpose,
        uint256 _unlockTimestamp,
        uint256 _penaltyBps,
        uint256 _bonusSplitBps,
        uint256 _initialDeposit
    ) external returns (address) {
        // 1. Deploy Vault
        KineticVault vault = new KineticVault(
            token,
            kToken,
            _purpose,
            msg.sender, 
            _unlockTimestamp,
            _penaltyBps,
            _bonusSplitBps,
            protocolTreasury
        );

        address vaultAddr = address(vault);
        allVaults.push(vaultAddr);
        userVaults[msg.sender].push(vaultAddr);
        isVault[vaultAddr] = true;

        // 2. Initial Deposit: USER -> VAULT (Hold First)
        if (_initialDeposit > 0) {
            // No manual check here anymore; safeTransferFrom will revert naturally with a clear trace
            IERC20(token).safeTransferFrom(msg.sender, vaultAddr, _initialDeposit);
            
            // 3. Trigger Kinetic supply from the Vault's internal balance
            vault.supplyHeldBalance(_initialDeposit);
        }

        emit KineticVaultCreated(vaultAddr, msg.sender, _purpose, _unlockTimestamp, _initialDeposit);
        return vaultAddr;
    }

    function getUserVaults(address _user) external view returns (address[] memory) {
        return userVaults[_user];
    }
}

